const quotes = [
  {
    body: `A goal is not always meant to be reached, it often
    serves simply as something to aim at.`,
    author: `Bruce Lee`
  },
  {
    body: `Do not fear the winds of adversity. Remember, a kite
    rises against the wind rather than with it.`,
    author: `Unknown`
  },
  {
    body: `The privilege of a lifetime is being who you are.`,
    author: `Joseph Campbell`
  },
  {
    body: `Be an encourager, the world has enough critics already.`,
    author: `Unknown`
  },
  {
    body: `Success is not final, failure is not fatal: it
    is the courage to continue that counts.`,
    author: `Winston Churchill`
  },
  {
    body: `You never know how strong you are until being
    strong is the only choice you have.`,
    author: `Unknown`
  },
]

export default quotes;
